import React from 'react';
import { NavLink } from 'react-router-dom';

export default function Overlay(props) {
  return (
		<div className={`overlay-menu ${props.isOpen ? "" : "active-menu"}`}>
			<ul>
				<li>
					{" "}
					<NavLink to="/" onClick={props.toggle}>
						Home
					</NavLink>{" "}
				</li>
				<li>
					{" "}
					<NavLink to="/about" onClick={props.toggle}>
						About
					</NavLink>{" "}
				</li>
				<li>
					{" "}
					<NavLink to="/products" onClick={props.toggle}>
						Products
					</NavLink>{" "}
				</li>
				<li>
					{" "}
					<NavLink to="/recipes">Recipes</NavLink>{" "}
				</li>
				<li>
					{" "}
					<NavLink to="/kids">Kid's Corner</NavLink>{" "}
				</li>
				<li>
					{" "}
					<NavLink to="/contact">Contact Us</NavLink>{" "}
				</li>
			</ul>
		</div>
  );
}
